import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the first visible product card (featured products grid)
    await page.waitForSelector('.product-card', { timeout: 5000 });

    // Click the first product card to open the Product Detail Modal
    const productCards = await page.$$('.product-card');
    if (productCards.length === 0) {
      throw new Error('No product cards found on the page');
    }
    await productCards[0].click();

    // Wait for the modal to appear (wait for .modal[style*="display: block"])
    // The modal has id="productModal" and style="display: block" when open
    await page.waitForSelector('#productModal', { timeout: 5000 });
    // Wait for the modal to be visible (display: block)
    await page.waitForFunction(() => {
      const modal = document.getElementById('productModal');
      return modal && window.getComputedStyle(modal).display !== 'none';
    }, { timeout: 5000 });

    // Take screenshot of the opened Product Detail Modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_product_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_product_modal_open.png'));

    // Extract product title and price from the modal for verification
    const productTitle = await page.$eval('#productDetail .product-detail-title', el => el.textContent.trim());
    const productPrice = await page.$eval('#productDetail .product-detail-price', el => el.textContent.trim());

    return {
      success: true,
      action: "Opened the Product Detail Modal by clicking the first product card",
      extractedData: {
        productTitle,
        productPrice
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
